import React, { Component } from 'react';
import Nash from './Nash';
class Project extends Component {
	constructor() {
		super();

		this.state = {
			sefo: [ { id: 1, img: 'img/5.jpg' }, { id: 3, img: 'img/1.jpg' }, { id: 2, img: 'img/3.jpg' } ]
		};
		const em = sefo.map((s) => <Nash key={s.id} img={s.img} />);
	}

	render() {
		return <div className="row">{em}</div>;
	}
}
export default Project;
